luckyNumber = random.randint(1, 32)

#set the color to pink cuz I link pink :D
set_color = '\033[95m'
reset_color = '\033[39m'

#find terminal width
ter_width = os.get_terminal_size().columns

#calculate the picture size
pic_lines = gallery[luckyNumber].split('\n')
pic_width = 0
for lines in pic_lines:
    pic_width = max(pic_width, len(lines))
spaces = max(0, (ter_width - pic_width) // 2)

#print the picture
for lines in pic_lines:
    print(set_color + ' ' * spaces + lines + reset_color);